import React, { useEffect, useState } from 'react';
import {
  Box, TextField, MenuItem, Table, TableBody, TableCell, TableContainer,
  TableHead, TableRow, Paper, Button, Dialog, DialogTitle, DialogContent,
  DialogActions, IconButton, FormControl, InputLabel, Select
} from '@mui/material';
import { styled } from '@mui/material/styles';
import CloseIcon from '@mui/icons-material/Close';
import { Formik, Form, Field } from 'formik';
import axios from 'axios';
import InterviewPortal from './InterviewPortal';

// Styled Components
const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  '& .MuiDialogContent-root': { padding: theme.spacing(2) },
  '& .MuiDialogActions-root': { padding: theme.spacing(1) },
}));

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  backgroundColor: '#1976d2',
  color: 'white',
  fontSize: 14,
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': { backgroundColor: theme.palette.action.hover },
}));

const SubCategory = () => {
  const [open, setOpen] = useState(false);
  const [categories, setCategories] = useState([]);
  const [subcategories, setSubcategories] = useState([]);
  const [initialValues, setInitialValues] = useState({
    subCategoryName: '',
    categoryID: '',
  });

  // Fetch categories
  const fetchCategories = () => {
    axios.get('https://interviewback-ucb4.onrender.com/category/list')
      .then((res) => setCategories(res.data.data))
      .catch((error) => console.error("Error fetching categories:", error));
  };

  // Fetch subcategories
  const fetchSubcategories = () => {
    axios.get('https://interviewback-ucb4.onrender.com/subcategory/')
      .then((res) => setSubcategories(res.data.data))
      .catch((error) => console.error("Error fetching subcategories:", error));
  };

  useEffect(() => {
    fetchCategories();
    fetchSubcategories();
  }, []);

  // Handle form submission
  const handleSubmit = (values, { resetForm }) => {
    axios.post('https://interviewback-ucb4.onrender.com/subcategory/create', values)
      .then(() => {
        fetchSubcategories();
        setOpen(false);
        resetForm();
      })
      .catch((error) => console.error("Error creating subcategory:", error));
  };

  return (
    <InterviewPortal>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
        <TextField select label="Search Category" fullWidth>
          {categories.map((cat) => (
            <MenuItem key={cat._id} value={cat._id}>
              {cat.categoryName}
            </MenuItem>
          ))}
        </TextField>

        <Button sx={{ backgroundColor: '#1976d2', color: 'white', ml: 2 }} onClick={() => setOpen(true)}>
          ADD SUB-CATEGORY
        </Button>
      </Box>

      {/* Add Subcategory Modal */}
      <BootstrapDialog open={open} onClose={() => setOpen(false)}>
        <DialogTitle>
          Add Subcategory
          <IconButton sx={{ position: 'absolute', right: 8, top: 8 }} onClick={() => setOpen(false)}>
            <CloseIcon />
          </IconButton>
        </DialogTitle>

        <Formik initialValues={initialValues} onSubmit={handleSubmit}>
          {({ setFieldValue }) => (
            <Form>
              <DialogContent dividers>
                <Field as={TextField} name="subCategoryName" label="Subcategory Name" fullWidth sx={{ mb: 2 }} />

                <FormControl fullWidth>
                  <InputLabel>Category</InputLabel>
                  <Select name="categoryID" onChange={(e) => setFieldValue('categoryID', e.target.value)}>
                    {categories.map((cat) => (
                      <MenuItem key={cat._id} value={cat._id}>
                        {cat.categoryName}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
              </DialogContent>

              <DialogActions>
                <Button type="submit" sx={{ backgroundColor: '#1976d2', color: 'white' }}>
                  Submit
                </Button>
              </DialogActions>
            </Form>
          )}
        </Formik>
      </BootstrapDialog>

      {/* Subcategories Table */}
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <StyledTableCell>No.</StyledTableCell>
              <StyledTableCell align="left">Subcategory Name</StyledTableCell>
              <StyledTableCell align="left">Category Name</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {subcategories.map((subcat, index) => (
              <StyledTableRow key={subcat._id}>
                <StyledTableCell>{index + 1}</StyledTableCell>
                <StyledTableCell align="left">{subcat.subCategoryName}</StyledTableCell>
                <StyledTableCell align="left">{subcat.categoryName}</StyledTableCell>
              </StyledTableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </InterviewPortal>
  );
};

export default SubCategory;
